import base64

# Base64 string (jo aapne diya tha) ko yahan paste karein
base64_string = ""
# Base64 ko decode karke binary data mein convert karna
image_data = base64.b64decode(base64_string)

# Image ko file ke roop mein save karna
with open("output_image.png", "wb") as file:
    file.write(image_data)

print("Image successfully saved as 'output_image.png'")
